import React, { Component } from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Link, Switch} from 'react-router-dom'
import Home from './components/Content/Content';

// 路由表

class App extends Component {
  render() {
    return (
      <Route 
      path="/" 
      exact
      component={Home} />   

    );
  }
}

export default App;
